import "./Navbar.css";
import Logo from '../assets/logo.png'
import { useNavigate } from "react-router-dom";

const Navbar = () => {

    const navigation = useNavigate();

    const [menuStatus, setMenuStatus] = useState(false);
    const handle_menu = ()=>{
        setMenuStatus(!menuStatus);

    }

    return(
        <>
        <div id="main_navbar">
            <div id="main_nav_left">
                <img src={Logo} alt="Sage cage and grills logo"/>
            </div>

            <div id="main_nav_right">
                <p onClick={()=>{navigation("/")}}>Home</p>
                <p onClick={()=>{navigation("/aboutUs")}}>About us</p>
                <p onClick={()=>{navigation("/contact")}} >Contact</p>
                <p onClick={()=> {navigation("/franchise")}}>Franchise</p>
            </div>
        </div>
        </>
    );
}

export default Navbar;
